css:
/** https://applitools.github.io/demo/TestPages/FramesTestPage/ **/

		#centered {
			margin: auto;
			width: 450px;
			height: 300px;
			border: 3px solid green;
			background: lightgreen;
		}

		#stretched {
			width: 100%;
			height: 200px;
			border: 3px solid blue;
			background: lightblue;
		}

		h1 {
			font-family: "Times New Roman", serif;
			font-size: 32px;
			font-weight: bold;
		}

		div { 
			font-family: "Times New Roman", serif;
			line-height: 18px;
		}

		.modal-content {
			margin: 2em auto;
			width: 400px;
			box-shadow: 0px 5px 20px rgba(0,0,0,1);
		}

		#modal-content {
			background: linear-gradient(to bottom, #7aef22 0%,#3bd8d8 33%, #4152ca 66%, #e967f9 100%);
			padding: 2em;
		  font-size: larger;
    	text-align: justify;
    	line-height: 1.25em;
			min-height: 120vh;
		}

		.modal {
			overflow: auto;
			position: fixed; 
			top: 0; 
			left: 0;
			right: 0;
			bottom: 0;
			background: rgba(0,0,0,0.5);
		}
